const ulStyle = {
  listStyle: "none",
  margin: "none",
  padding: "none",
  textAlign: "right",
};

const liStyle = {
  listStyle: "none",
  display: "inline-block",
  padding: "10px 10px 10px 10px",
};

export default {
  liStyle,
  ulStyle,
};
